import {Tab} from "./tab";
import React from "react";
const Gallery = (props) => {

    const files = [{src: "https://imagenfis.epn.edu.ec/images/casas-abiertas/2014/20141202_093424.jpg"},
        {src: "https://imagenfis.epn.edu.ec/images/casas-abiertas/2014/20141202_093512.jpg"},
        {src:  "https://imagenfis.epn.edu.ec/images/casas-abiertas/2014/20141202_093520.jpg"},
        {src:   "https://imagenfis.epn.edu.ec/images/casas-abiertas/2014/20141202_093530.jpg"},
        {src:   "https://imagenfis.epn.edu.ec/images/casas-abiertas/2014/20141202_093559.jpg"},
        {src:   "https://imagenfis.epn.edu.ec/images/casas-abiertas/2014/20141202_093629.jpg"}]
    return <div>
        {
            files.map((files) => (
                  <img src={files.src} alt={""}/>
            ))
        }
    </div>
}
export default Gallery
